import menu from '../menu';

const Navbar = () => {
    return (
        <nav>
            <ul>
                {menu.map((item, index) => {
                    return (
                        <li>
                            <a href={item.url}>{item.title}</a>
                        </li>
                    );
                })}
            </ul>
        </nav>
    );
};

export default Navbar;
